    "Mason Neck National Wildlife Refuge Annual narrative report: Calendar year 1984",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-10-15T16:36:24.935823",nt"name": "mason-neck-national-wildlife-refuge-annual-narrative-report-calendar-year-1984",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Mason
    Neck National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
    year. The report begins with an introduction to the Refuge and information about
    climate conditions, and land acquisition. The planning section discusses the management
    plan and research and investigations. Administration topics are covered; topics
    include personnel, youth programs, volunteer program, funding, and safety. Habitat
    management is covered; grasslands, wetlands, and fire management are discussed.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, migratory birds, game mammals, marking and banding, and disease
    prevention and control. Interpretation and recreation activities are outlined; topics
    include information and interpretation, recreation, and law enforcement. The equipment
    and facilities section discusses rehabilitation, equipment utilization, and replacement.
    Items of interest are discussed. Brief narratives for Marumsco National Wildlife
    Refuge and Featherstone National Wildlife Refuge are included. Photographs and brochures
    are attached.",nt"license_title": "License Not Specified",nt"extras":
